import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import ContainedButtons from "../ui/ContainedButttons";
import HomeIcon from "./HomeIcon";
import "../../../../index.css";
import Link from "@material-ui/core/Link";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    height: "auto",
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
    fontFamily: "Lobster",
  },
}));

export default function GenNavBar(props) {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar
        position="static"
        style={{ backgroundColor: "#f7f7f7", margin: 0 }}
      >
        <Toolbar>
          <Typography
            variant="h6"
            className={classes.title}
            style={{ textAlign: "left" }}
          >
            <Link href="/" style={{ color: "#2a6bf4" }}>
              My Portfolio
            </Link>
          </Typography>
          <div
            style={{
              flloat: "left",
              marginRight: "80em",
            }}
          >
            <HomeIcon style={{ color: "#2a6bf4" }}></HomeIcon>
          </div>

          <ContainedButtons
            signInNav={props.signInNav}
            signUpNav={props.signUpNav}
          ></ContainedButtons>
        </Toolbar>
      </AppBar>
    </div>
  );
}
